  import { initializeApp } from "https://www.gstatic.com/firebasejs/9.6.10/firebase-app.js";
  import { getFirestore, collection, addDoc, serverTimestamp, getDocs, query, orderBy } from "https://www.gstatic.com/firebasejs/9.6.10/firebase-firestore.js";
  
  const app = initializeApp(firebaseConfig);
  const db = getFirestore(app);

  window.onload = function() {
    // Get the URL parameter 'to'
    const urlParams = new URLSearchParams(window.location.search);
    const nameFromURL = urlParams.get('to');

    // If 'to' parameter exists, set the value to the 'name' input field
    if (nameFromURL) {
        document.getElementById('name').value = nameFromURL;
    }
  }
  // Fungsi untuk menampilkan toast notification
  function showToast(message, type = 'success') {
    const toast = document.getElementById('toast');
    toast.textContent = message;

    // Atur warna berdasarkan jenis notifikasi
    if (type === 'success') {
      toast.style.backgroundColor = '#28a745'; // Hijau untuk sukses
    } else if (type === 'error') {
      toast.style.backgroundColor = '#dc3545'; // Merah untuk error
    }

  // Tampilkan toast
  toast.classList.add('show');

  // Sembunyikan toast setelah 3 detik
  setTimeout(() => {
    toast.classList.remove('show');
  }, 3000);
}

  
  // Handle form submission
  document.getElementById('rsvpForm').addEventListener('submit', async function(event) {
    event.preventDefault();
  
    const name = document.getElementById('name').value;
    const commentar = document.getElementById('commentar').value;
    const attending = document.getElementById('attending').value;
  
    // Simpan data ke Firestore
    try {
      await addDoc(collection(db, 'EgiTasya'), {
        name,
        commentar,
        attending,
        timestamp: serverTimestamp()
      });
  
      showToast('Terima kasih! RSVP Anda telah dikirim.', 'success');
      document.getElementById('rsvpForm').reset(); // Reset form
      loadRSVPs(); // Muat ulang daftar RSVP
    } catch (error) {
      console.error('Error saving RSVP:', error);
      showToast('Terjadi kesalahan saat mengirim RSVP. Silakan coba lagi.', 'error');
    }
  });
  
  function formatTimestamp(timestamp) {
    const date = timestamp.toDate(); // Konversi Firestore timestamp ke JavaScript Date
    const options = { 
      day: 'numeric', 
      month: 'long', 
      year: 'numeric', 
      hour: '2-digit', 
      minute: '2-digit',
      hour12: false // Gunakan format 24 jam
    };
    return date.toLocaleString('en-GB', options).replace(',', ' at'); // Ganti koma dengan "at"
  }
  
  async function loadRSVPs() {
    const rsvpItems = document.getElementById('rsvpItems');
    rsvpItems.innerHTML = ''; // Kosongkan daftar sebelum memuat ulang
  
    try {
      const rsvpQuery = query(collection(db, 'EgiTasya'), orderBy('timestamp', 'desc'));
      const querySnapshot = await getDocs(rsvpQuery);
  
      querySnapshot.forEach((doc) => {
        const data = doc.data();
        const rsvpItem = document.createElement('div');
        rsvpItem.className = 'comment-item';
  
        // Format timestamp
        const formattedTimestamp = data.timestamp ? formatTimestamp(data.timestamp) : 'No timestamp';
  
        // Tampilkan badge berdasarkan kehadiran
        const badgeClass = data.attending === 'Hadir' ? 'badge-success' : 'badge-danger';
        const badge = `<span class="badge ${badgeClass}">${data.attending}</span>`;
  
        // Buat avatar dari nama tamu
        const avatarUrl = `https://ui-avatars.com/api/?size=40&background=random&color=random&name=${encodeURIComponent(data.name)}`;
  
        // Struktur HTML untuk setiap komentar
        rsvpItem.innerHTML = `
        <div class="comment-item" bis_skin_checked="1">
          <div class="d-flex">
            <img src="${avatarUrl}" alt="${data.name}" loading="lazy" class="avatar rounded-circle" style="height: 30px; width: 30px;">
            <div class="ml-2 text-left">
              <p class="mb-0 font-weight-bold">${data.name} ${badge}</p>
              <p class="mb-0">${data.commentar || 'Tidak ada komentar'}</p>
              <small>${formattedTimestamp}</small>
            </div>
          </div>
        </div>
        `;
  
        rsvpItems.appendChild(rsvpItem);
      });
    } catch (error) {
      console.error('Error loading RSVPs:', error);
      rsvpItems.innerHTML = '<div class="text-danger">Gagal memuat data RSVP. Silakan muat ulang halaman.</div>';
    }
  }
  
  // Muat daftar RSVP saat halaman dimuat
  loadRSVPs();